    return (
        <View style={styles.viewStyle}>
            <Button
                title="First Semester"
                onPress={() => {props.navigation.navigate('Course'),firstSemesterCourse} } />
            <Button
                title="Second Semester"
                onPress={() => { }} />
            <Button
                title="Third Semester"
                onPress={() => { }} />
        </View>
    );
}

const styles = StyleSheet.create({
    viewStyle: {
        flex: 2,
